data:
  definition: rapport, exprimé en valeur numérique ou en %, de la puissance à la pointe
    de charge d'un client, d'un groupe de clients ou d'un groupe d'installations,
    à la valeur de cette pointe; ces deux valeurs étant observées au même niveau du
    réseau
  examples: []
  notes:
  - Il convient de préciser à quel moment se rapporte l'observation.
